    false,nt"url": null,nt"notes": " The MTDB represents a seamless national
    file with no overlaps or gaps between parts, however, each TIGER/Line File is designed
    to stand alone as ann               independent data set, or they can be combined
    to cover the entire nation.  The Feature Names Relationship File (FEATNAMES.dbf)
    contains a record for eachn               feature name and any attributes associated
    with it.  Each feature name can be linked to the corresponding edges that make up
    that feature in the Alln               Lines Shapefile (EDGES.shp), where applicable
    to the corresponding address range or ranges in the Address Ranges Relationship
    File (ADDR.dbf), or to bothn               files.  Although this file includes feature
    names for all linear features, not just road features, the primary purpose of this
    relationship file is ton               identify all street names associated with
    each address range.  An edge can have several feature names; an address range located
    on an edge can ben               associated with one or any combination of the available
    feature names (an address range can be linked to multiple feature names).  The address
    range isn               identified by the address range identifier (ARID) attribute,
    which can be used to link to the Address Ranges Relationship File (ADDR.dbf).  The
    linearn               feature is identified by the linear feature identifier (LINEARID)
    attribute,  which can be used to relate the address range back to the name attributesn
                  of the feature in the Feature Names Relationship File or to the feature
    record in the Primary Roads, Primary and Secondary Roads, or All Roadsn               Shapefiles.
    The edge to which a feature name applies can be determined by linking the feature
    name record to the All Lines Shapefile (EDGES.shp) usingn               the permanent
    edge identifier (TLID) attribute.  The address range identifier(s) (ARID) for a
    specific linear feature can be found by using the linearn               feature
    identifier (LINEARID) from the Feature Names Relationship File (FEATNAMES.dbf) through
    the Address Range / Feature Name Relationship Filen               (ADDRFN.dbf).
    n               n               The TIGER/Line shapefiles and related database files
    (.dbf) are an extract of selected geographic and cartographic information from then
                  U.S. Census Bureau's Master Address File / Topologically Integrated
    Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB representsn
